from base64 import b64decode
ico = b''
ico = b64decode(ico)
if __name__ == "__main__":
    import tkinter as tk
    from tkinter import ttk
    try:
        import pywinstyles
    except ImportError:
        import os
        os.system("pip install pywinstyles")
        import pywinstyles
    import sys
    import json
    import os

    config = {
        "life": 10,
        "speed": 5,
        "particle_pool": 25,
        "particle_burst": 2,
        "click_burst": 3,
        "trail_chance": 1,
        "trail_speed": 50,
        "trail_wind": 2,
        "h_drag": 0.8,
        "v_drag": 0.8,
        "delta_vx": 10,
        "delta_vy": 10,
        "delta_br": 1,
        "delta_trail": 5,
        "br_precision": 63,
        "scale": 0.6,
        "x_offset": 0,
        "y_offset": 0,
        "offset_first": False,
        "x_scale": 1.0,
        "y_scale": 1.0,
        "hidden_spawn_only": False,
        "taskbar_height": 1,
        "win32_event_filter_": [
            523,
            524
        ],
        "behaviour": {
            "x1": "keyboard.type(\"\");sparkle(x, y)",
            "x2": "keyboard.type(\" (d20:{})\".format(randint(1, 20)));play(\"dice\")"
        }
    }

    root = tk.Tk()
    root.title("Config Editor")
    root.iconbitmap(f"{os.path.abspath(os.getcwd())}\\assets\\sparkle.ico")

    style = ttk.Style()
    style.theme_use("alt")

    style.configure("TFrame", background="#1c1c1c")
    style.configure("TLabel", background="#1c1c1c", foreground="#ffffff")
    style.configure("TEntry", background="#1c1c1c", fieldbackground="#888888", foreground="#ffffff")
    style.configure("TButton", background="#888888", foreground="#ffffff", borderwidth=0, focusthickness=0,
                    focuscolor="none")
    style.configure("TScrollbar", background="#1c1c1c")

    try:
        style.element_create("Vertical.Scrollbar.trough", "from", "alt")
        style.element_create("Vertical.Scrollbar.thumb", "from", "alt")
        style.element_create("Vertical.Scrollbar.grip", "from", "alt")
        style.layout("TScrollbar", [
            ('Vertical.Scrollbar.trough', {'children': [('Vertical.Scrollbar.thumb', {'unit': '1', 'children': [
                ('Vertical.Scrollbar.grip', {'sticky': 'nswe'})], 'sticky': 'nswe'})], 'sticky': 'ns'}),
        ])
    except Exception as e:
        print(style.theme_names(), e)

    style.configure("TScrollbar", background="#3e3e3e", troughcolor="#101010", gripcount=0)
    style.map("TScrollbar", background=[('active', '#4e4e4e')])
    style.map("TButton",
              background=[('pressed', '#2e2e2e'), ('active', '#4e4e4e')],
              foreground=[('pressed', '#ffffff'), ('active', '#ffffff')],
              relief=[('pressed', 'sunken'), ('!pressed', 'raised')])

    canvas = tk.Canvas(root, borderwidth=0, highlightthickness=0, background="#1c1c1c")
    scrollbar = ttk.Scrollbar(root, orient="vertical", command=canvas.yview)
    scrollable_frame = ttk.Frame(canvas, width=100)

    scrollable_frame.bind(
        "<Configure>",
        lambda e: canvas.configure(
            scrollregion=canvas.bbox("all")
        )
    )

    canvas.create_window((0, 0), window=scrollable_frame, anchor="nw")
    canvas.configure(yscrollcommand=scrollbar.set)

    canvas.pack(side="left", fill="both", expand=True)
    scrollbar.pack(side="right", fill="y")

    entries = {}

    for key, value in config.items():
        frame = ttk.Frame(scrollable_frame)
        frame.pack(fill="x", padx=5, pady=5)
        label = ttk.Label(frame, text=key)
        label.pack(side="left", padx=5)
        if isinstance(value, dict):
            for sub_key, sub_value in value.items():
                sub_frame = ttk.Frame(scrollable_frame)
                sub_frame.pack(fill="x", padx=10, pady=2)
                sub_key_entry = ttk.Entry(sub_frame)
                sub_key_entry.insert(0, sub_key)
                sub_key_entry.pack(side="left", padx=5)
                sub_value_entry = ttk.Entry(sub_frame)
                sub_value_entry.insert(0, sub_value)
                sub_value_entry.pack(side="left", padx=5)
                entries[f"{key}:{sub_key}"] = (sub_key_entry, sub_value_entry)
            add_button = ttk.Button(frame, text="Add Behaviour", command=lambda k=key: add_behaviour(k))
            add_button.pack(side="left", padx=5)

        elif isinstance(value, list):
            entry = ttk.Entry(frame)
            entry.insert(0, " ".join(map(str, value)))
            entry.pack(side="left", fill="x", expand=True)
            entries[key] = entry
        else:
            entry = ttk.Entry(frame)
            entry.insert(0, value)
            entry.pack(side="left", fill="x", expand=True)
            entries[key] = entry


    def add_behaviour(key):
        sub_frame = ttk.Frame(scrollable_frame)
        sub_frame.pack(fill="x", padx=10, pady=2)
        sub_key_entry = ttk.Entry(sub_frame)
        sub_key_entry.pack(side="left", padx=5)
        sub_value_entry = ttk.Entry(sub_frame)
        sub_value_entry.pack(side="left", padx=5)

        def update_entries(*args):
            entries[f"{key}:{sub_key_entry.get()}"] = (sub_key_entry, sub_value_entry)

        sub_key_entry.bind("<FocusOut>", update_entries)
        sub_key_entry.bind("<FocusOut>", lambda e: delete_empty_entries(sub_key_entry, sub_frame, key))


    def delete_empty_entries(entry, frame, key=None):
        if entry.get() == "":
            frame.destroy()
            if key:
                entries.pop(f"{key}:{entry.get()}", None)


    def save_to_file():

        saved_data = {}
        for key, entry in entries.items():
            if isinstance(entry, tuple):
                sub_key_entry, sub_value_entry = entry
                saved_data.setdefault("parsed_behaviour", {})[sub_key_entry.get()] = sub_value_entry.get()
            else:
                if key.startswith("parsed_behaviour:"):
                    key = key.split(":", 1)[1]
                    saved_data.setdefault("parsed_behaviour", {})[key] = entry.get()
                elif key == "win32_event_filter":
                    saved_data[key] = list(map(int, entry.get().split()))
                else:
                    try:
                        if entry.get().lower() in ["true", "false"]:
                            saved_data[key] = entry.get().lower() == "true"
                        elif "." in entry.get():
                            saved_data[key] = float(entry.get())
                        else:
                            saved_data[key] = int(entry.get())
                    except ValueError:
                        saved_data[key] = entry.get()
        with open("config.json", "w") as file:
            json.dump(saved_data, file, indent=4)


    def on_ctrl_s(event):
        save_to_file()


    root.bind_all("<Control-s>", on_ctrl_s)


    def apply_theme_to_titlebar(root):
        version = sys.getwindowsversion()
        if version.major == 10 and version.build >= 22000:
            pywinstyles.change_header_color(root, "#1c1c1c")
        elif version.major == 10:
            pywinstyles.apply_style(root, "dark")
            root.wm_attributes("-alpha", 0.99)
            root.wm_attributes("-alpha", 1)


    apply_theme_to_titlebar(root)

    root.mainloop()
